import React, { Component } from "react";
import { TextField, Container, Button, CardMedia } from "@material-ui/core";
import Background from "../images/website-login-background.jpg";

class Login extends Component {
  render() {
    return (
      <div className="container">
        <h3>LOGIN</h3>
        <CardMedia image={require("")}>
          <TextField
            style={{ width: 500 }}
            label="Email"
            margin="dense"
            variant="standard"
          />
          <br />
          <TextField
            style={{ width: 500 }}
            label="Passworld"
            margin="dense"
            variant="standard"
            type="password"
          />
          <br />
          <Button
            onClick={() => {
              console.log("AA");
            }}
            style={{
              width: 500,
              marginTop: 50,
              background: "yellow",
              color: "black"
            }}
          >
            LOGIN
          </Button>
        </CardMedia>
      </div>
    );
  }
}

export default Login;
